import React from 'react'

const Card = ({pokemon})=>{
    return(
        <div calssName="card">
            <div className="cardImg">
                <img src={pokemon.sprites.front_default} alt=""></img>
            </div>
            <h3 calseName="cardName">{pokemon.name}</h3>
            <div className="cardTypes">
                <div>タイプ</div>
                {pokemon.types.map((type)=>{
                    return <div>
                        <span>{type.type.name}</span>
                    </div>

                })}
            </div>

        </div>
    )
}

export default Card;
